Now that we've published our application on the network, let's query it to get the current counter value. To interact with an application on the network, we need to use the client running in 'service' mode. This will expose a bunch of API's locally which we can use to interact with applications on the network. To run the client in service mode, make sure you're in ./target/debug and run: ./client --storage rocksdb:client.db --wallet wallet.json --genesis genesis.json --max-pending-messages 10000 service Navigate to http://localhost:8080 in your browser to access the GraphiQL, the GraphQL IDE. We'll look at this in more detail in a future section ; for now, list the applications deployed on your local network by running: query { applications { id description link }
} Since we've only deployed one application, the results returned have a single entry. At the bottom of the returned JSON there is a field called link, to interact with your deployed application copy and past the link into a new browser tab. Finally, to query the counter value of our deployed application, run: query { value
} This will return a value of 35, which is the initialisation argument we specified when deploying our application.
